@xofficial.th  Dancers Training Program Vol.02  Finally  เหลือเเค่ Final Video ออกมาเร็วๆนี้เเน่นอน 🔥 ก่อนอื่น อยากชื่นชมทุกคนที่มีส่วนร่วมกับการเทรนครั้งที่ 2 ของปีนี้ อย่างมาก เพราะรอบนี้จำนวนคนที่เพิ่มขึ้นเท่าตัว ทำให้การเรียน มีความยากขึ้นมาเท่าตัวเช่นกัน เเต่ในเเต่ละ Week ทุกคนได้พบเจอทั้งการเรียน เเละปัญหา ซึ่งเเน่นอนว่าทุกคนผ่านไปได้อย่างสวยงามเสมอ และ ในอนาคตก็เช่นกัน ทุกคนจะเติบโตไปอีก 10 เท่า 100 เท่าไม่มีวันหยุด เพราะวินัยที่ทำให้ผลักดันตัวเองมารวมกันได้นี้ เป็นการฝึกที่เหนื่อยเเล้วก็สนุกมากๆจริงๆคับ  ยังไงฝาก Vol.03 ที่กำลังจะเกิดขึ้นเร็วๆนึ้ และ Final Vol.02 Video ด้วยนะคับ แล้วพลกันคับ 

